import { useState } from "react";
import Rate from "../Rate";


const Rating = () => {
    const [rating, setRating] = useState(0);

    return (
        <>
            <div>
             <h2>Rating page</h2>
            </div>
            <div>
                <p>Rate me</p>
            </div>
            <div>
                <Rate rating = {rating} onRating = {(rate) => setRating(rate)}/>
                <p>Rating: {rating}</p>
            </div>
        </>
    )
}

export default Rating;
